import React from 'react'
import {Divider, Drawer, Grid, makeStyles} from '@material-ui/core'

const styles = makeStyles({
    root:{
        padding: '1vw'
    }
})

interface IProps{
    open: boolean
    handleClose: () => void
}

const SideMenu: React.FC<IProps> = (props) =>{

    const {open, handleClose} = props
    const useStyle = styles()

    return(
        <Drawer
            anchor='left'
            open = {open}
            onClose={handleClose}>
            <Grid
                className={useStyle.root}
                container>
                
            </Grid>
        </Drawer>
    )
}

export default SideMenu;
